import React, {useEffect, useState} from 'react';
import { Posting } from "../../types";
import "../../styles/communityStyles/boardLayout.css"
import axios from "axios";

interface BoardLayOutProps {
    postings: Posting[];
}

const BoardLayOut: React.FC<BoardLayOutProps> = ({ postings }) => {

    const [postingId, setPostingId] = useState<number>(0);
    const callPostingDetail = (id) => {

        useEffect(() => {
            axios.get('/post')
                .then(response => setPostingId(response.data))
                .catch(error => console.log(error))
        }, []);
    };

    return (
        <main className={"boardLayOut"}>
            <section className={"topSide"}>

            </section>

            <table>
                <colgroup>
                    <col style={{ width: '10%' }} />
                    <col style={{ width: '15%' }} />
                    <col style={{ width: '45%' }} />
                    <col style={{ width: '20%' }} />
                    <col style={{ width: '10%' }} />
                </colgroup>
                <thead>
                    <tr>
                        <th>글 번호</th>
                        <th>작성자</th>
                        <th>제목</th>
                        <th>작성일</th>
                        <th>조회수</th>
                    </tr>
                </thead>
                <tbody>
                    {postings.map((posting) => (
                        <tr key={posting.id}>
                            <td>{posting.id}</td>
                            <td>{posting.name}</td>
                            <span onClick={() => callPostingDetail(posting.id)}>{posting.title}</span>
                            <td>{posting.createdate}</td>
                            <td>{posting.views}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <section className={"bottomSide"}>

            </section>
        </main>
    );
};

export default BoardLayOut;
